--
-- Name: fund_investment_transaction_vw; Type: VIEW; Schema: app; Owner: finapp
--

CREATE VIEW fund_investment_transaction_vw AS
 SELECT fit.id,
    fit.value_date,
    f.currency_id,
    c.iso_code AS currency,
    fit.share_amount,
    ((fit.share_amount)::double precision * fp.price) AS tr_value,
    fit.account_id,
    a.account_name,
    fit.fund_id,
    f.fund_name,
    a.tax_rate_percent,
    f.isin
   FROM ((((fund_investment_transaction fit
     JOIN fund f ON ((fit.fund_id = f.id)))
     LEFT JOIN fund_price fp ON (((fit.fund_id = fp.fund_id) AND (fit.value_date = fp.value_date))))
     JOIN currency c ON ((f.currency_id = c.id)))
     LEFT JOIN account a ON ((fit.account_id = a.id)));


ALTER TABLE app.fund_investment_transaction_vw OWNER TO finapp;

--
-- Name: fund_inv_tr_acc_bal_vw; Type: VIEW; Schema: app; Owner: finapp
--

CREATE VIEW fund_inv_tr_acc_bal_vw AS
 SELECT t.account_id,
    t.account_name,
    t.tr_value,
    t.value_date AS valid_from,
    COALESCE((lead(t.value_date) OVER (PARTITION BY t.account_id ORDER BY t.value_date) - 1), get_last_fundprice_date()) AS valid_to,
    sum(t.tr_value) OVER (PARTITION BY t.account_id ORDER BY t.value_date) AS balance
   FROM ( SELECT fit.account_id,
            fit.account_name,
            fit.value_date,
            sum(round(fit.tr_value)) AS tr_value
           FROM fund_investment_transaction_vw fit
          GROUP BY fit.account_id, fit.account_name, fit.value_date) t;


ALTER TABLE app.fund_inv_tr_acc_bal_vw OWNER TO finapp;

