CREATE VIEW fund_inv_tr_portfolio_bal_vw AS
 SELECT t.id AS portfolio_id,
    t.name AS portfolio_name,
    t.tr_value,
    t.value_date AS valid_from,
    COALESCE((lead(t.value_date) OVER (PARTITION BY t.id ORDER BY t.value_date) - 1), get_last_fundprice_date()) AS valid_to,
    sum(t.tr_value) OVER (PARTITION BY t.id ORDER BY t.value_date) AS balance
   FROM ( SELECT p.id,
            p.name,
            fit.value_date,
            sum(round(fit.tr_value)) AS tr_value
           FROM fund_investment_transaction_vw fit,
            portfolio_x_account_rltnp pxa,
            portfolio p
          WHERE ((fit.account_id = pxa.account_id) AND (pxa.portfolio_id = p.id))
          GROUP BY p.id, p.name, fit.value_date) t;


