CREATE VIEW fund_price_recent_vw AS
 SELECT t.id,
    t.fund_id,
    t.value_date,
    t.price,
    t.last_modification
   FROM ( SELECT row_number() OVER (PARTITION BY fund_price.fund_id ORDER BY fund_price.value_date DESC) AS rn,
            fund_price.id,
            fund_price.fund_id,
            fund_price.value_date,
            fund_price.price,
            fund_price.last_modification
           FROM fund_price) t
  WHERE (t.rn = 1);


