--
-- Name: rate_value_intrate_vw; Type: VIEW; Schema: app; Owner: finapp
--

CREATE VIEW rate_value_intrate_vw AS
 SELECT t1.id,
    t1.rate_id,
    t1.rate_name,
    tt.valdate AS value_date,
    t1.value
   FROM ( SELECT t.id,
            t.rate_id,
            t.rate_name,
            t.value_date,
            t.value,
            COALESCE((lag(t.value_date) OVER (PARTITION BY t.rate_id ORDER BY t.value_date DESC) - 1), (now())::date) AS valid_to
           FROM ( SELECT rv.id,
                    rv.rate_id,
                    r.rate_name,
                    rv.value_date,
                    rv.value
                   FROM rate_value rv,
                    rate r
                  WHERE ((rv.rate_id = r.id) AND (r.rate_type = 'interest'::text))) t) t1,
    ( SELECT (date_trunc('day'::text, dd.dd))::date AS valdate
           FROM generate_series((( SELECT min(rv.value_date) AS min
                   FROM rate_value rv,
                    rate r
                  WHERE ((rv.rate_id = r.id) AND (r.rate_type = 'interest'::text))))::timestamp without time zone, (now())::timestamp without time zone, '1 day'::interval) dd(dd)) tt
  WHERE ((tt.valdate >= t1.value_date) AND (tt.valdate <= t1.valid_to));


ALTER TABLE app.rate_value_intrate_vw OWNER TO finapp;

